  false,\n\t\"url\": null,\n\t\"notes\": \"This data set depicts 30-year averages
  (1961-1990) of monthly and annual temperatures for Minnesota. Isolines and regions
  were created using kriging and latticecontour operations on temperature point data
  from a 5-state area. Data is stored in a regions model, with separate regions for
  each monthly and annual 30-year average (e.g., region.apr represents the average
  April temperatures across Minnesota for the period 1961-1990).\",\n\t\"license_title\":
